const opa = this.getObjectByName('opa');
const opb = this.getObjectByName('opb');
const result = this.getObjectByName('result');
const ops = {
    '+': ()=> this.gameData.a + this.gameData.b,
    '-': ()=> this.gameData.a - this.gameData.b,
    '*': ()=> this.gameData.a * this.gameData.b,
    '/': ()=> this.gameData.a / this.gameData.b,
};

this.gameData = {
    op: '+',
    a: 1,
    b: 1,
};

this.next = ()=> {
    this.gameData.a = Math.ceil(Math.random() * 100);
    this.gameData.b = Math.ceil(Math.random() * 100) + 1;
    this.gameData.op = world.randomChoice(['+','-','*', '/']);
    opa.props.text = `${this.gameData.a}`;
    opb.props.text = `${this.gameData.b}`;
    result.props.text = ops[this.gameData.op]().toFixed(3).replace(/(\.0+)|0+$/, '');
};
this.commit = (op)=> {
    if (op !== this.gameData.op) {
        return;
    }
    this.next();
}
this.next();

const text = world.scene.getObjectByName('text');
const drum = this.getObjectByName('drum');

drum.play();

world.scene.commit('+');

